import React from "react";


export default function Textform(Props) {
  return (
    <>
      <h1>{Props.heading}</h1>
      <div className="mb-3">
        <label htmlFor="exampleFormControlInput1" className="form-label">
          ENTER THE TEXT
        </label>
        <input
          type="Text"
          className="form-control"
          id="exampleFormControlInput1"
          placeholder="Enter the text"
        />
      </div>
    </>
  );
}
